INSERT INTO "public"."assessments" ("id", "slug", "title", "description", "estimated_duration", "icon", "is_active", "sort_order", "created_at", "updated_at", "framework_id", "assessment_level_id") VALUES
	('00000000-0000-0000-0000-000000000001', 'core-fundamentals-i', 'CORE I - Fundamentals', 'Essential coaching fundamentals: Active Listening, Powerful Questions, and Present Moment Awareness', 20, '', true, 1, '2025-08-07 10:42:51.0867+00', '2025-08-15 10:18:36.507464+00', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132'),
	('00000000-0000-0000-0000-000000000003', 'core-fundamentals-iii', 'CORE III - Mastery', 'Demonstrate mastery of sophisticated coaching interventions, complex client dynamics, and advanced NLP techniques.', 45, '', false, 3, '2025-08-07 10:42:51.0867+00', '2025-08-15 10:18:36.507464+00', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '55e58986-65bf-49df-ae9f-54b396f74d22'),
	('00000000-0000-0000-0000-000000000006', 'icf-core-iii', 'ICF III - Mastery', 'ICF mastery level: facilitates client growth through complex scenarios, advanced coaching presence, and sophisticated awareness creation.', 60, '', false, 3, '2025-08-07 10:42:51.0867+00', '2025-08-15 10:18:36.507464+00', '2fc5803d-6938-4ea8-9559-8f2b48e6badf', '55e58986-65bf-49df-ae9f-54b396f74d22'),
	('00000000-0000-0000-0000-000000000008', 'ac-practice-ii', 'AC II - Applied Practice', 'Advanced AC competencies: working with goals, understanding clients, outcome orientation, and systematic model application.', 35, '', false, 2, '2025-08-07 10:42:51.0867+00', '2025-08-15 10:18:36.507464+00', '28b91c63-b5fa-4b18-bf02-5a1996dbac6c', 'a2021eb1-93fb-4f23-8d2b-5ee1da88dc8c'),
	('00000000-0000-0000-0000-000000000009', 'ac-mastery-iii', 'AC III - Professional Mastery', 'AC mastery level: sophisticated client understanding, complex goal architecture, and advanced coaching model integration.', 50, '', false, 3, '2025-08-07 10:42:51.0867+00', '2025-08-15 10:18:36.507464+00', '28b91c63-b5fa-4b18-bf02-5a1996dbac6c', '55e58986-65bf-49df-ae9f-54b396f74d22'),
	('00000000-0000-0000-0000-000000000002', 'core-fundamentals-ii', 'CORE II - Intermediate Skills', 'Develop advanced coaching techniques: creating awareness, designing actions, managing progress, and exploring deeper client meanings.', 30, '', false, 2, '2025-08-07 10:42:51.0867+00', '2025-08-15 11:12:28.131256+00', 'f83064ee-237c-45b1-9db6-e6212c195cdb', 'a2021eb1-93fb-4f23-8d2b-5ee1da88dc8c'),
	('00000000-0000-0000-0000-000000000004', 'icf-core-i', 'ICF I - Foundation', 'ICF core competencies foundation: demonstrates ethical practice, embodies coaching mindset, establishes agreements, and cultivates trust.', 25, '', false, 1, '2025-08-07 10:42:51.0867+00', '2025-08-15 11:12:45.478502+00', '2fc5803d-6938-4ea8-9559-8f2b48e6badf', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132'),
	('00000000-0000-0000-0000-000000000007', 'ac-foundation-i', 'AC I - Foundation', 'Association for Coaching foundation: self-management, coaching understanding, building relationships, and effective communication.', 25, '', false, 1, '2025-08-07 10:42:51.0867+00', '2025-08-15 11:12:03.080139+00', '28b91c63-b5fa-4b18-bf02-5a1996dbac6c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132'),
	('00000000-0000-0000-0000-000000000005', 'icf-core-ii', 'ICF II - Core Practice', 'Advanced ICF competencies: maintains presence, listens actively, evokes awareness with sophisticated coaching interventions.', 40, '', false, 2, '2025-08-07 10:42:51.0867+00', '2025-08-15 11:12:58.839363+00', '2fc5803d-6938-4ea8-9559-8f2b48e6badf', 'a2021eb1-93fb-4f23-8d2b-5ee1da88dc8c');
INSERT INTO "public"."competency_display_names" ("id", "competency_key", "display_name", "is_active", "created_at", "description", "framework_id") VALUES
	('8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', 'active_listening', 'Active Listening', true, '2025-08-12 00:46:58.936963+00', 'Listening fully to understand client meaning, emotions, and unspoken concerns beyond just words.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('d4477ae7-e3ce-428c-bb1d-235c89e7f05c', 'powerful_questions', 'Powerful Questions', true, '2025-08-12 00:46:58.936963+00', 'Asking open-ended questions that provoke insight, challenge assumptions, and help clients discover new perspectives.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('f1c88df8-cfec-4e1c-85d0-327fdb23af61', 'present_moment_awareness', 'Present Moment Awareness', true, '2025-08-12 00:46:58.936963+00', 'Staying fully present to notice energy shifts, body language, tone changes, and subtle client cues in real-time.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('64888b9f-5c07-4bd1-affa-cc99a3bba77f', 'advanced_active_listening', 'Advanced Active Listening', true, '2025-08-21 21:13:24.665321+00', 'Advanced listening skills including emotional layer recognition, pattern awareness, and somatic integration.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('2640accd-a78a-4ddc-9916-b756e07d2b1c', 'strategic_powerful_questions', 'Strategic Powerful Questions', true, '2025-08-21 21:13:24.665321+00', 'Strategic questioning techniques that challenge beliefs, explore core drives, and reframe perspectives.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('6dddbf00-a782-4327-b751-71e18282b16c', 'creating_awareness', 'Creating Awareness', true, '2025-08-21 21:13:35.914082+00', 'Advanced awareness creation including strength-shadow recognition, internal process awareness, and self-role recognition.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('86552202-948a-458e-81ac-4d15b7b82daf', 'trust_psychological_safety', 'Trust & Psychological Safety', true, '2025-08-21 21:13:35.914082+00', 'Creating safe spaces through vulnerability honoring, empathetic boundary-keeping, and emotional expression normalization.', 'f83064ee-237c-45b1-9db6-e6212c195cdb'),
	('f77a29c6-ccff-4dd7-b964-57f809a113b0', 'direct_communication', 'Direct Communication', true, '2025-08-21 21:13:45.417779+00', 'Advanced direct communication including impact-based communication, relationship-preserving directness, and pattern confrontation.', 'f83064ee-237c-45b1-9db6-e6212c195cdb');
INSERT INTO "public"."assessment_questions" ("id", "assessment_id", "question_order", "scenario", "question", "option_a", "option_b", "option_c", "option_d", "correct_answer", "explanation", "difficulty_weight", "created_at", "updated_at", "competency_id", "assessment_level_id", "correct_answer_option_id", "is_active") VALUES
	('7acf6831-986a-4471-aa54-fa83c06b5d59', '00000000-0000-0000-0000-000000000001', 1, 'Sarah, a 38-year-old marketing director, is tearfully sharing how she feels lost after being passed over for a promotion she expected. She''s questioning whether to stay in her company of 10 years or risk starting over elsewhere.', 'How should you listen as Sarah shares this emotional career setback?', 'Focus on how her story relates to your own career disappointments', 'Listen deeply to both her words and the emotions behind them', 'Consider what her colleagues might think about her situation', 'Think about advice you could give her about job searching', 2, 'When someone is emotional, they need to feel truly heard. Listening to both their words and feelings shows you''re really there with them, not just waiting for your turn to talk.', 1, '2025-08-16 20:07:22.214705+00', '2025-08-16 20:07:22.214705+00', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('6d14f5d4-ec22-41ca-9aee-6c8e40e67f96', '00000000-0000-0000-0000-000000000001', 2, 'Marcus, an entrepreneur, is rapidly listing multiple business decisions he needs to make: whether to hire his first employee, move to a larger office space, and take on a major client project - all while his personal savings are running low.', 'How do you best reflect back what you''re hearing from Marcus?', 'I went through something similar when I started my business - it''s really tough.', 'What I''m hearing is that you''re juggling multiple major decisions while feeling financial pressure.', 'Don''t stress about it - most entrepreneurs face these challenges.', 'Have you considered prioritizing just one decision at a time?', 2, 'Great reflection is like being a clear mirror - you show Marcus exactly what he shared so he knows you really got it. No advice needed, just genuine understanding.', 1, '2025-08-16 20:07:22.284576+00', '2025-08-16 20:07:22.284576+00', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('ad779202-a389-45f4-842b-fa2dc0ada0fb', '00000000-0000-0000-0000-000000000001', 3, 'Kevin, a usually reserved accountant, takes a deep breath and quietly shares: ''I''ve never told anyone this, but I''ve been struggling with anxiety attacks before important presentations. It''s affecting my career prospects.''', 'How do you best respond to Kevin''s vulnerable disclosure to build trust and safety?', 'Kevin, that''s interesting - can you tell me more about when these anxiety attacks typically happen?', 'I can see why that would be really difficult to deal with, especially in your profession.', 'Thank you for trusting me with something so personal, Kevin. What feels most important about this for you right now?', 'You should be proud of yourself for having the courage to share that with me.', 3, 'When someone shares something deeply personal, thanking them for their trust creates a safe space. It shows you honor their vulnerability instead of rushing to fix or judge.', 1, '2025-08-16 20:07:22.340475+00', '2025-08-16 20:07:22.340475+00', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 3, true),
	('688a9956-fc27-4ccc-9d54-e248980fbd86', '00000000-0000-0000-0000-000000000001', 4, 'Patricia, a department head, is second-guessing her decision to restructure her team after two employees expressed concerns. She''s worried she may have acted too hastily and damaged team morale.', 'How do you best support Patricia while maintaining psychological safety in the coaching space?', 'Patricia, I hear you questioning your restructuring decision, and I''m curious what feels most important to explore about that.', 'Based on what you''ve shared about the employee concerns, here''s what I think you should do next...', 'That sounds like a really challenging leadership situation that many department heads face.', 'Let''s focus on finding solutions for the team morale issue rather than dwelling on what''s already happened.', 1, 'Stay curious instead of jumping into advice mode. This response keeps Patricia feeling safe to explore her thoughts without pressure to defend her decisions.', 1, '2025-08-16 20:07:22.407198+00', '2025-08-16 20:07:22.407198+00', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 1, true),
	('1d3b1444-0fc6-4c3a-9b19-39d2fd7ae9b6', '00000000-0000-0000-0000-000000000001', 5, 'Nicole, a real estate agent, mentions having a ''situation with a client'' but then becomes vague, avoiding eye contact and changing the subject when you ask for more details about what happened.', 'How do you best navigate Nicole''s reluctance to share while practicing active listening?', 'Let''s move on to something else that might be easier for you to discuss right now.', 'Nicole, I can sense there might be more to this client situation. What feels safe to share right now?', 'It''s completely okay if you don''t want to talk about this - we all have things we prefer to keep private.', 'Sometimes it really helps to talk through these difficult client situations, even when it feels uncomfortable.', 2, 'When someone seems hesitant to share, gently acknowledging what you sense while respecting their boundaries often helps them feel safer to open up.', 1, '2025-08-16 20:07:22.476206+00', '2025-08-16 20:07:22.476206+00', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('176d3db6-3346-4231-b6bb-7b1e380af427', '00000000-0000-0000-0000-000000000001', 6, 'David, a software engineer who was recently laid off, slumps in his chair and says: ''I always mess things up. I probably said something wrong in my last performance review that led to this.''', 'Which question would most powerfully challenge David''s limiting belief?', 'What specifically happened in that performance review that concerns you?', 'Why do you think you have this pattern of self-sabotage?', 'How long have you been carrying this story about yourself?', 'What would someone who truly knows your capabilities say about this situation?', 4, 'Sometimes we''re our own worst critic. This question helps David step outside his harsh self-talk by imagining what someone who truly knows his strengths would say.', 1, '2025-08-16 20:07:22.539891+00', '2025-08-16 20:07:22.539891+00', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 4, true),
	('39e6dbed-3b62-4412-98aa-d083c48e4bc1', '00000000-0000-0000-0000-000000000001', 7, 'Jennifer, a nurse practitioner, is considering leaving her stable hospital job to open her own wellness practice. She''s torn between financial security and pursuing her passion for holistic medicine.', 'Which question would best help Jennifer connect with what truly matters to her?', 'What do you think would be the financially smarter decision?', 'What matters most to you about how you want to spend your professional life?', 'What would your family and colleagues advise you to do?', 'What are the financial risks versus benefits of each option?', 2, 'This cuts through all the external noise and gets to the heart of what really matters to Jennifer. It''s about her authentic desires, not everyone else''s expectations.', 1, '2025-08-16 20:07:22.592563+00', '2025-08-16 20:07:22.592563+00', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('dfd4cd06-0196-4849-9591-46f9ad3b3496', '00000000-0000-0000-0000-000000000001', 8, 'Michael, a recent college graduate, is paralyzed between accepting a well-paying consulting job his parents approve of or pursuing his dream of teaching abroad with the Peace Corps for much less money.', 'Which question would best help Michael access his authentic desires beyond external expectations?', 'Which option do you think would make your parents prouder?', 'What does your gut instinct tell you about each path?', 'If you close your eyes and imagine yourself in each role, which one feels more aligned with who you''re becoming?', 'Which choice would be easier to defend to your family?', 3, 'This question invites Michael to feel into his future, not just think about it. Our bodies often know the right answer before our minds catch up.', 1, '2025-08-16 20:07:22.661518+00', '2025-08-16 20:07:22.661518+00', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 3, true),
	('83b04379-224e-495e-a844-3ef7332da303', '00000000-0000-0000-0000-000000000001', 9, 'Carlos, a middle manager, keeps asking what you think he should do about his underperforming team member. He''s looking for direct advice and seems frustrated when you redirect back to him, saying ''I just need someone to tell me the right answer.''', 'How do you respond to Carlos''s request for advice while empowering him to find his own solution?', 'Carlos, what would need to be true for you to feel completely confident in your approach with this team member?', 'Based on what you''ve shared, here''s exactly what I think you should do with this employee...', 'Most managers in your situation would probably start with a formal performance improvement plan.', 'You seem to already know what needs to happen - what''s holding you back from taking action?', 1, 'Instead of giving Carlos the fish, this question helps him learn to fish. It focuses on building his confidence rather than creating dependence on your advice.', 1, '2025-08-16 20:07:22.717826+00', '2025-08-16 20:07:22.717826+00', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 1, true),
	('95510e8f-abcf-43a9-9872-6bbb93ea58b1', '00000000-0000-0000-0000-000000000001', 11, 'During a session with Elena, a busy executive, you catch your mind drifting to your own challenges with work-life balance as she describes her 60-hour work weeks and missing her daughter''s soccer games.', 'What''s your best response when you notice your attention has wandered in this present moment?', 'Continue listening and hope Elena doesn''t notice your distraction.', 'Gently redirect your full attention back to Elena without judgment.', 'Ask Elena to pause and repeat what she just shared with you.', 'Start taking detailed notes to help you stay more focused.', 2, 'Mind wandering happens to everyone! The key is catching it quickly and coming back without beating yourself up. Self-compassion keeps you present for your client.', 1, '2025-08-16 20:07:22.841015+00', '2025-08-16 20:07:22.841015+00', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('9daed53c-4f88-45ff-9730-41d0bbfb6eca', '00000000-0000-0000-0000-000000000001', 13, 'Robert, a financial advisor, is mid-sentence explaining his frustration with a difficult client when he suddenly stops talking, stares out the window, and appears to be thinking deeply about something.', 'How do you best support Robert in this moment of internal processing?', 'Ask him what''s going through his mind to keep the conversation moving forward.', 'Hold the silence and create space for whatever insight might be emerging.', 'Offer your perspective on what he might be realizing about the situation.', 'Summarize what he''s shared about the difficult client to refocus the conversation.', 2, 'Sometimes the most powerful thing you can do is absolutely nothing. Silence gives Robert space for his own insights to emerge naturally.', 1, '2025-08-16 20:07:22.969279+00', '2025-08-16 20:07:22.969279+00', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 2, true),
	('9b81e22a-49f4-4390-b978-11efaaa50751', '00000000-0000-0000-0000-000000000001', 15, 'Tom, a sales manager, has mentioned in three separate sessions that when faced with conflict, he either completely avoids the conversation or immediately becomes defensive. He doesn''t seem to recognize this pattern himself.', 'How do you best help Tom become aware of his unconscious conflict pattern?', 'Tell him directly: Tom, you keep avoiding conflict or getting defensive - you need to see this pattern.', 'Ask: Tom, what do you notice about how you typically respond when conflict arises?', 'Wait for him to figure out the pattern on his own without your intervention.', 'Ask: What patterns are you noticing in how you handle challenging conversations?', 4, 'Help Tom become the observer of his own patterns. When people discover their habits themselves, they''re more likely to actually change them.', 1, '2025-08-16 20:07:23.068951+00', '2025-08-16 20:07:23.068951+00', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 4, true),
	('602b66c5-7d56-457e-809e-f32532f214ba', '00000000-0000-0000-0000-000000000001', 10, 'Rachel, a talented graphic designer, sighs and says: ''I''m just not leadership material. I''ve never been good at managing people or making big decisions. Maybe I should just stay in my current role forever.''', 'How do you challenge Rachel''s limiting belief while maintaining a supportive coaching relationship?', 'Rachel, what would you tell a dear friend who shared these exact same doubts about their capabilities?', 'You''re being too hard on yourself - you need to stop thinking so negatively about your potential.', 'Why do you always jump to worst-case scenarios about your leadership abilities?', 'Rachel, what might become possible if this belief about not being leadership material wasn''t actually true?', 4, 'This gently challenges Rachel''s limiting story without making her feel wrong. It opens up new possibilities by questioning the belief itself, not attacking it.', 1, '2025-08-16 20:07:22.789283+00', '2025-08-16 20:07:22.789283+00', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 4, true),
	('f7f6958c-68db-4bdd-95cf-53a42edf3884', '00000000-0000-0000-0000-000000000001', 12, 'Lisa, a project manager, started the session enthusiastically discussing her new role. Halfway through, when you ask about her team dynamics, her posture changes, she looks down, and her voice becomes quieter and more hesitant.', 'How should you address Lisa''s visible shift in energy and body language?', 'Continue discussing her new role without mentioning the change you observed.', 'Ask directly: Why did your energy just change when I asked about your team?', 'Share your observation: Lisa, I noticed your energy shifted when we moved to team dynamics. What''s happening for you?', 'Save your observation for the end of the session to avoid interrupting her flow.', 3, 'Bodies often tell the truth before words do. Gently sharing what you notice helps Lisa become aware of her own signals and what they might mean.', 1, '2025-08-16 20:07:22.910395+00', '2025-08-16 20:07:22.910395+00', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 3, true),
	('3efc7912-9972-47cc-9c3f-97e6c7a77102', '00000000-0000-0000-0000-000000000001', 14, 'Amanda, a high school teacher, is describing a conflict with her principal. While her words are factual and measured, you notice her jaw is clenched, her hands are fidgeting, and there''s tension in her shoulders.', 'How do you best help Amanda become aware of what her body is communicating?', 'Tell her directly that she seems angry or frustrated about the situation.', 'Ask Amanda: How are you feeling right now as you talk about this?', 'Share your observation: Amanda, I''m noticing tension in your body as you describe this conflict. What are you aware of?', 'Focus only on the factual content she''s sharing rather than her physical responses.', 3, 'Our bodies hold so much wisdom! Pointing out Amanda''s physical tension helps her tune into messages she might be missing from her own nervous system.', 1, '2025-08-16 20:07:23.022649+00', '2025-08-16 20:07:23.022649+00', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 3, true);
INSERT INTO "public"."competency_consolidated_insights" ("id", "competency_id", "framework_id", "assessment_level_id", "analysis_type_id", "performance_insight", "development_focus", "practical_application", "is_active", "created_at", "updated_at") VALUES
	('c65efb21-1382-4a88-b6fa-c0fa247b08ca', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4', 'Based on your Active Listening assessment results, you''re experiencing what most developing coaches encounter: the challenge of staying fully present while simultaneously thinking about how to help. This creates a dual attention problem that reduces your ability to truly hear what clients are sharing. Your results indicate this competency requires foundational development, which is completely normal at this stage of your coaching journey. Strengthening this skill will transform not just your coaching effectiveness, but your ability to create the psychological safety that enables breakthrough conversations.', 'Your development path involves building what we call "coaching presence" - the ability to be fully available to another person without agenda. While your assessment provides specific techniques to practice, the deeper work involves rewiring your nervous system to stay calm and present under the pressure of "needing to help." This is foundational work that supports everything else you''ll develop as a coach. Consider this an investment in your professional capability that will serve you throughout your entire coaching career.', 'As you implement the specific practices from your assessment results, recognize that you''re building what clients will eventually describe as your "coaching presence." This competency directly impacts client retention, referrals, and your reputation as a coach. Clients can sense when a coach is truly listening versus waiting for their turn to talk. Mastering this early in your development creates a foundation for advanced skills like systemic coaching and organizational work. Document your progress as this becomes part of your professional development portfolio.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00'),
	('554bbf7d-e0c5-4980-a54d-36e53e80dff9', '8ff9f6ae-42e9-43af-a8a3-39f8066a2df0', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25', 'Your Active Listening assessment results place you in the strong competency range, indicating you''ve developed what many coaches struggle with for years: genuine presence and emotional attunement. This isn''t just a skill - it''s your emerging coaching identity. Clients likely comment on feeling "truly heard" with you, which is the foundation of transformational coaching relationships. Your results suggest you naturally create the psychological safety that enables clients to access their resourceful state and share vulnerable truths.', 'While your assessment shows specific ways to leverage this strength, your broader development opportunity involves becoming what we call a "master practitioner" of coaching presence. This means using your listening gift to identify systemic patterns, family-of-origin dynamics, and unconscious limiting beliefs. Your natural ability positions you for advanced coaching specializations like executive coaching, couples work, or organizational consulting where deep listening is essential.', 'Your listening strength is a significant professional asset that will drive client referrals and coaching success. As you apply the specific techniques from your assessment results, recognize that you''re developing what will become your signature coaching approach. Document client feedback about feeling "heard and understood" - this becomes part of your professional story and marketing. Consider pursuing advanced certifications that leverage this strength, such as trauma-informed coaching or organizational psychology applications.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00'),
	('3e61578b-825a-438a-84b5-a9efeb392db0', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4', 'Your Powerful Questions assessment results reveal a common challenge for coaches transitioning from helping professions: the impulse to provide solutions rather than facilitate discovery. This isn''t a deficiency - it''s evidence of your desire to help. However, your results indicate this competency requires development to unlock what makes coaching distinct from consulting or mentoring. The clients who benefit most from coaching are those who need to access their own wisdom, not receive someone else''s answers.', 'While your assessment provides specific questioning techniques to practice, your deeper development involves shifting your coaching identity from "expert advisor" to "facilitative partner." This represents a fundamental mindset change that supports client autonomy and sustainable change. This competency development will expand your client base to include those seeking empowerment rather than direction, which typically commands higher coaching fees and longer-term engagements.', 'As you implement the specific techniques from your assessment results, recognize that you''re developing one of the most commercially valuable coaching skills. Powerful questions separate professional coaches from life advisors and create the "aha moments" that clients remember and refer others for. Track which questions generate the strongest client responses - this becomes part of your coaching methodology and professional differentiator. This skill directly impacts your ability to work with executive and leadership clients.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00'),
	('60b2a072-6340-4a0c-8a11-1b206081ff32', 'd4477ae7-e3ce-428c-bb1d-235c89e7f05c', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25', 'Your Powerful Questions assessment results indicate you''ve developed what many consider the signature skill of masterful coaches: the ability to craft questions that unlock client insight and wisdom. This competency strength suggests you naturally understand that clients have their own answers and need skilled facilitation rather than expert advice. Your results place you among coaches who create those memorable "breakthrough moments" that clients talk about for years.', 'While your assessment shows specific ways to leverage this strength, your broader opportunity involves developing what we call "questioning artistry" - the ability to read client energy and craft questions that meet them exactly where they are. This strength positions you for high-level coaching work with executives, entrepreneurs, and organizational leaders who specifically seek thought partners rather than advisors. Consider developing specialized question methodologies that become part of your professional coaching brand.', 'Your questioning strength is a significant competitive advantage in the coaching marketplace. As you apply the specific techniques from your assessment results, recognize that clients will often attribute their breakthrough insights to your skilled questioning. Document the types of questions that generate the strongest client transformations - this becomes intellectual property and part of your coaching methodology. This competency directly supports premium positioning and can justify higher coaching fees, especially in executive and leadership coaching markets.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00'),
	('c5e92711-1ca9-4f00-a9d5-a475053959cd', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4', 'Your Present Moment Awareness assessment results highlight what many coaches experience: the challenge of staying present while managing the complexity of facilitating another person''s growth. This isn''t a personal failing - it''s evidence that you''re taking coaching seriously and want to do it well. However, your results indicate this foundational competency needs development to create the depth of connection that enables transformational coaching relationships. Clients can sense when coaches are truly present versus mentally preparing their next intervention.', 'While your assessment provides specific presence-building practices, your deeper development involves cultivating what we call "coaching consciousness" - the ability to hold space for another person''s unfolding without needing to control or direct it. This represents advanced emotional and psychological capacity that supports everything else you''ll develop as a coach. Consider this foundational nervous system training that will serve you throughout your coaching career and enable you to work with increasingly complex client dynamics.', 'As you implement the specific practices from your assessment results, recognize that you''re developing what will become your most valuable professional asset: the ability to create presence-based coaching relationships. This competency directly impacts client results, session quality, and your own sustainability as a coach. Coaches with strong presence report less coaching fatigue and more energizing client sessions. Document your progress with presence practices - this becomes part of your professional development and can support advanced certification applications.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00'),
	('c57e0c82-f760-4e92-8398-aaa7548ad7b4', 'f1c88df8-cfec-4e1c-85d0-327fdb23af61', 'f83064ee-237c-45b1-9db6-e6212c195cdb', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25', 'Your Present Moment Awareness assessment results indicate you''ve developed what many consider the most sophisticated coaching competency: the ability to be fully present with another person while tracking multiple layers of information simultaneously. This isn''t just a skill - it''s a way of being that clients find both calming and activating. Your results suggest you naturally create what we call "generative presence" where clients access resourceful states simply by being in your company. This represents years of personal and professional development work.', 'While your assessment shows specific ways to leverage this strength, your broader opportunity involves developing what we call "systemic presence" - the ability to hold space for complex family, team, and organizational dynamics. Your natural presence gift positions you for the most sophisticated coaching applications: executive coaching, organizational consulting, and team development work. Consider pursuing advanced certifications in somatic coaching, systemic coaching, or organizational psychology that build on this foundation.', 'Your presence strength represents your most valuable professional differentiator and competitive advantage. As you apply the specific techniques from your assessment results, recognize that clients will often say sessions with you feel "different" or "profound" compared to other coaches. This presence-based coaching commands premium fees and creates strong client loyalty. Document client testimonials about the quality of presence you bring - this becomes central to your professional marketing and supports premium positioning in executive, leadership, and organizational coaching markets.', true, '2025-08-17 11:44:56.186139+00', '2025-08-17 11:44:56.186139+00');
