INSERT INTO "public"."tag_actions" ("id", "skill_tag_id", "action_text", "is_active", "created_at", "analysis_type_id") VALUES
	('05bfc896-3d9d-4ee1-8b9d-8dd742f616a0', '53e2ad65-7950-4e5c-bcf0-be365dfe54e0', 'Practice: "What I heard is [content] and it sounds like you''re feeling [emotion]." Include both facts and feelings.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('eaf2f1fa-dcb9-4991-84af-5c828eb46efb', '522760bd-db7e-482d-9743-a951a2c08c42', 'Listen for feeling words and reflect them: "I hear frustration in your voice - tell me more about that feeling."', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('e56d24ae-1749-4bb7-ad4a-d278f4dac9a1', '33edb96e-c319-43f7-87a7-d7f9a1f7cd4f', 'When clients share something vulnerable, respond: "Thank you for trusting me with that. What feels most important about this for you right now?"', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('2fc859a0-df5d-4786-95c0-bf2a5f31d3f8', 'ed912333-a676-4236-918b-1a1671681cec', 'Ask: "What''s most important to you about how this unfolds?" to connect challenges with deeper values.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('4e8a41aa-2975-48d3-9d97-d7bbd88b39f8', '6d9c63e0-e500-4743-abd6-9837d2fb3d46', 'Ask: "How might someone with a different background view this situation?" to invite new perspectives.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('b08cf314-25f4-4c3a-b400-9efcaf81494b', 'fd73629e-7e5f-475b-964a-d5c1fb2c8886', 'Ask: "What would need to be true for you to feel completely confident in your approach?" instead of giving advice.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('1931e731-52ba-4181-b2bb-0a9a004ced3a', '6efa01fa-1b42-43b6-b58f-984117b536a9', 'Share observations: "I noticed your energy shifted when we moved to this topic. What''s happening for you right now?"', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('e4f084bc-4862-4be0-9cc8-5bd51e091661', 'f6d3e012-3e60-4370-82d5-5765ed45ace2', 'After asking a powerful question, count to 10 before speaking. Let silence create space for their insights to emerge.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('ac748bc7-cb1f-45e5-9ab8-315fc84e41a8', 'b230fd4d-6df5-431a-8280-76d426ab0af0', 'When you notice your attention wandering, take a breath and gently redirect your focus back to your client without judgment.', true, '2025-08-16 22:58:05.018834+00', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('1a94bf00-4c24-4c41-aba5-96b70c158b61', '53e2ad65-7950-4e5c-bcf0-be365dfe54e0', 'Since you excel at reflecting emotions, use this skill to help clients identify and name feelings they haven''t fully recognized yet.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('18a4d18e-b581-4697-a654-340a7a126bcc', '522760bd-db7e-482d-9743-a951a2c08c42', 'Your emotional sensitivity is a strength - use it to guide clients toward emotional breakthroughs and deeper self-awareness.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('438a1c57-3d63-4460-8681-f1e5bc9981e4', '33edb96e-c319-43f7-87a7-d7f9a1f7cd4f', 'Your ability to create safety allows you to hold space for clients'' most vulnerable sharing. Use this to facilitate profound healing conversations.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('c5c9cf04-310a-4715-9008-5b2b17b03993', 'ed912333-a676-4236-918b-1a1671681cec', 'Your values-based questioning is a superpower - use it to help clients make decisions that deeply align with who they are at their core.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('0d788728-1a64-4fe3-a650-bdb9aa93158b', '6d9c63e0-e500-4743-abd6-9837d2fb3d46', 'Your skill at offering new perspectives helps clients break free from limiting viewpoints. Use this to create major mindset shifts.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('78a05e39-d21c-4822-b70f-b120abc54d6f', 'fd73629e-7e5f-475b-964a-d5c1fb2c8886', 'Your empowering questions help clients access their inner wisdom. Use this strength to build their confidence in their own solutions.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('82155d9e-44f7-4c99-b109-e22dec4b3037', '6efa01fa-1b42-43b6-b58f-984117b536a9', 'Your sensitivity to energy shifts allows you to identify breakthrough moments. Use this skill to guide clients to their most profound insights.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('62c71838-b465-4003-aed9-b02b0107853d', 'f6d3e012-3e60-4370-82d5-5765ed45ace2', 'Your comfort with silence creates a powerful container for transformation. Use this strength to allow clients'' deepest wisdom to emerge.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('010ed485-cfb1-424a-9933-acb5decc1333', 'b230fd4d-6df5-431a-8280-76d426ab0af0', 'Your present-moment awareness creates focused presence that clients can feel. Use this strength to model the awareness you want them to develop.', true, '2025-08-16 22:58:05.018834+00', '378c3fca-d674-469a-b8cd-45e818410a25');
INSERT INTO "public"."tag_insights" ("id", "skill_tag_id", "insight_text", "created_at", "assessment_level_id", "analysis_type_id") VALUES
	('086440e1-1b75-4a30-bba9-9d1486fce212', '53e2ad65-7950-4e5c-bcf0-be365dfe54e0', 'Missing emotional undertones when reflecting back client sharing.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('5cd2f815-d00d-4d31-a605-5c240c98f352', '522760bd-db7e-482d-9743-a951a2c08c42', 'Focusing only on factual content while missing the emotional dimensions of client sharing.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('ef9a7a44-f734-450d-8e64-cc51d1cccb7d', '33edb96e-c319-43f7-87a7-d7f9a1f7cd4f', 'Struggling to respond appropriately when clients share vulnerable or sensitive information.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('f4eb8ba5-2de9-4aa5-a073-3169f5cc2188', 'ed912333-a676-4236-918b-1a1671681cec', 'Missing opportunities to help clients connect their challenges with their deeper values and what matters most.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('e0d02a9b-513d-4dd6-ac46-d1477f5f2058', '6d9c63e0-e500-4743-abd6-9837d2fb3d46', 'Not offering questions that help clients consider alternative viewpoints or reframe their challenges.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('bf204d27-43a6-4634-a181-d3903848e6a9', 'fd73629e-7e5f-475b-964a-d5c1fb2c8886', 'Giving advice or solutions instead of empowering clients to access their own wisdom and capabilities.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('7add7376-3b9d-4c1e-a110-df075bc08568', '6efa01fa-1b42-43b6-b58f-984117b536a9', 'Missing client energy shifts, body language changes, and other present-moment cues during sessions.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('4e8a6b0a-150d-4531-9f4c-f9e6795e697d', 'f6d3e012-3e60-4370-82d5-5765ed45ace2', 'Rushing to fill silence instead of allowing clients the processing time they need for insights to emerge.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('2beaeef9-5e43-4536-a1dc-85af7f40ec88', 'b230fd4d-6df5-431a-8280-76d426ab0af0', 'Mind wandering during sessions instead of maintaining present-moment awareness with your client.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', 'b2f61b8d-66c9-4d79-8fcd-58fd3bb370e4'),
	('cda808e2-699c-4fb1-b910-93b400fa6e87', '53e2ad65-7950-4e5c-bcf0-be365dfe54e0', 'Strong at reflecting both content and emotional undertones back to clients.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('88ee553b-8069-41d4-bce9-e2979f3c3125', '522760bd-db7e-482d-9743-a951a2c08c42', 'Your sensitivity to emotional nuances helps clients develop greater emotional awareness and process feelings safely.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('20e9e05f-80cb-41f0-afab-bd33525b6b9d', '33edb96e-c319-43f7-87a7-d7f9a1f7cd4f', 'Your skillful responses to vulnerability create psychological safety that allows clients to share authentically.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('0a592e3e-ba3b-4fe1-86eb-9b0e0175e8d4', 'ed912333-a676-4236-918b-1a1671681cec', 'Your values-based questions help clients connect with their core values for authentic decision-making.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('86e34274-1f7d-4c9b-9281-6d45f862db25', '6d9c63e0-e500-4743-abd6-9837d2fb3d46', 'Your questions skillfully invite clients to consider new perspectives and challenge limiting assumptions.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('c3d11874-7270-4405-a70e-2fcd452dc0c1', 'fd73629e-7e5f-475b-964a-d5c1fb2c8886', 'Your empowering questions help clients access their own wisdom and feel confident in their solutions.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('33b53c78-d61c-4cd3-9d03-f90e60418da8', '6efa01fa-1b42-43b6-b58f-984117b536a9', 'Your sensitivity to energy shifts helps you identify important moments and guide clients toward deeper awareness.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('e7209740-ecb6-4832-b064-46d1b697ac2f', 'f6d3e012-3e60-4370-82d5-5765ed45ace2', 'Your comfort with silence creates space for clients to process deeply and access their most profound insights.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25'),
	('be481ccc-bfd3-4c02-a44f-244fc41bc696', 'b230fd4d-6df5-431a-8280-76d426ab0af0', 'Your ability to notice and redirect your attention creates a container of focused presence for your clients.', '2025-08-16 22:58:05.018834+00', '9f6e38cc-8f1b-4ab9-b019-a5f5be0c3132', '378c3fca-d674-469a-b8cd-45e818410a25');
