	('3d420965-3fc4-4002-8b9f-22ab196066e1', 1, 'experience_inventory', 'Specific life or work experiences to bring into coaching', 'list', 'Add an experience...', 'What specific life or work experiences do you want to bring into your coaching?', true, 4, '2025-08-17 20:35:56.265143+00'),
	('7e7b0ea9-e2d9-4a8a-9c2f-a4feb95ea181', 2, 'awards_qualifications', 'Awards & Qualifications', 'list', 'Add an award or qualification...', 'Any relevant awards, certifications, or training?', true, 1, '2025-08-17 20:36:27.79693+00'),
	('34a8f826-f508-4200-8fe2-8d9cd54a825d', 2, 'what_fires_you_up', 'What Fires You Up?', 'textarea', 'Write your thoughts...', 'What causes or social missions excite you? Are you supporting any charities, or want to? Who inspires you most?', true, 2, '2025-08-17 20:36:27.79693+00'),
	('8a9f41bb-71b1-494b-9b39-b64e0fe0089f', 2, 'future_self_letter', 'Letter to Future Self', 'textarea', 'Start your letter...', 'Write a letter to your future self: "I''m proud of the impact I made on ______."', true, 3, '2025-08-17 20:36:27.79693+00'),
	('3dc04c43-9bd9-4c1a-9744-454bdebcf05d', 2, 'section1_reflection', 'Reflection Space', 'textarea', 'Reflect here...', 'What did you discover about yourself in this section? How could this shape your brand or coaching style?', true, 4, '2025-08-17 20:36:27.79693+00'),
	('255c7604-2ed3-40b8-8238-1fab662967ac', 3, 'ideal_client_description', 'Describe Your Ideal Client', 'textarea', 'Describe them here...', 'Imagine your ideal client is sitting across from you. What do they look like? What are they worried about? What''s their "secret" struggle?', true, 1, '2025-08-17 20:36:27.79693+00'),
	('05a5efc0-1e3d-4ec2-8207-026767a1bb16', 3, 'avatar_sketch', 'Avatar Sketch', 'textarea', 'Draw or describe here...', 'Draw your ideal client (stick figures welcome!). What''s in their bag? What''s on their mind?', true, 2, '2025-08-17 20:36:27.79693+00'),
	('3c4a4be0-3963-40bc-9cea-4a756f93bc26', 3, 'peer_review_feedback', 'Peer Review Feedback', 'textarea', 'Peer feedback...', 'Share your description with a peer. Ask: "Does this sound real? What''s missing?"', true, 3, '2025-08-17 20:36:27.79693+00'),
	('58e38e1e-1f95-4a58-801b-13990cf60b51', 3, 'self_check_quiz', 'Self-Check Quiz Answers', 'textarea', 'Your answers...', '1. True or False: Your ideal client can be "anyone who needs help." 2. Which is a better pain point? - Wants to be happier OR - Feels lost after a career change', true, 4, '2025-08-17 20:36:27.79693+00'),
	('c16170d8-09fd-4665-b5c8-610851b0ec7c', 4, 'brand_identity', 'Brand Identity', 'textarea', 'Write your thoughts...', 'Who do you want to be seen as? Will you use your own name or a company? Try a "tag": "Hi, I''m [Name] and I''m the [Something] Coach."', true, 1, '2025-08-17 20:36:27.79693+00'),
	('da0df6fd-00a5-4277-8776-4a8320990d6a', 4, 'tagline_brainstorm', 'Tagline Brainstorm', 'list', 'Add a tagline...', 'Set a timer for 3 minutes. Write as many silly, serious, or strange taglines as you can.', true, 2, '2025-08-17 20:36:27.79693+00'),
	('1f8c6c5a-56e6-4013-9b3e-29503ee3331b', 4, 'mission_statement', 'Mission Statement', 'textarea', 'Draft your mission...', 'Think big. What do you want to achieve for the world or with your life?', true, 3, '2025-08-17 20:37:03.479882+00'),
	('869c9241-1473-4637-a237-6b4111646e5a', 4, 'brand_reflection', 'Brand Reflection', 'textarea', 'Reflect here...', 'What did you learn about your brand identity? How does it feel?', true, 5, '2025-08-17 20:37:03.479882+00'),
	('e663839f-6bd4-4fd7-b335-b2ebaef8cbca', 5, 'visual_avatar_ideas', 'Visual Avatar Ideas', 'textarea', 'Ideas...', 'What image or symbol could represent your brand? Is it personal and relevant?', true, 1, '2025-08-17 20:37:03.479882+00'),
	('f67f91ee-11d3-482a-a2be-8a4399ebf838', 5, 'research_notes', 'Research Notes', 'textarea', 'Notes...', 'Find 3 coaching websites. What images do they use? What stands out?', true, 2, '2025-08-17 20:37:03.479882+00'),
	('c0eaaca6-d55d-4fa0-9931-92bf16912a92', 6, 'session_based_pros_cons', 'Session-Based Pros/Cons', 'textarea', 'Pros: ____  Cons: ____', 'List pros and cons for session-based coaching.', true, 1, '2025-08-17 20:37:03.479882+00'),
	('6aa91f76-e89e-48c0-8571-d9bdd6801374', 6, 'program_based_pros_cons', 'Program-Based Pros/Cons', 'textarea', 'Pros: ____  Cons: ____', 'List pros and cons for program-based coaching.', true, 2, '2025-08-17 20:37:03.479882+00'),
	('3ce34ec8-adda-42dd-8a23-95f97c9854d6', 6, 'unique_program_ideas', 'Unique Program Ideas', 'textarea', 'Ideas...', 'What can you offer that''s different from everyone else? What unique experience can you create?', true, 3, '2025-08-17 20:37:03.479882+00'),
	('81838112-55b0-4154-9b93-b4318bcc7a49', 6, 'love_doing_activities', 'Activities You Love', 'list', 'Add an activity...', 'List 3 things you love doing that could become part of your program.', true, 4, '2025-08-17 20:37:03.479882+00'),
	('84f370c7-b103-4640-a11c-9cb35f239bca', 7, 'funnel_mapping', 'Funnel Mapping', 'textarea', 'Map your funnel...', 'Work backwards from your ideal client. What will you offer them? What''s your freemium product? What''s your warm-up product?', true, 1, '2025-08-17 20:37:03.479882+00'),
	('997ee553-6a37-406f-a9ba-63c4813b1175', 7, 'freemium_pitch', 'Freemium Product Pitch', 'textarea', 'Pitch: ____  Feedback: ____', 'Write a one-sentence pitch for your freemium product. Share it with a friend. What''s their reaction?', true, 2, '2025-08-17 20:37:03.479882+00'),
	('5e52220b-ccbd-49db-adb2-88f4e83f4554', 8, 'website_actions', 'Website Actions', 'list', 'Add an action...', 'List five actions you''ll take to sharpen your website.', true, 1, '2025-08-17 20:37:03.479882+00'),
	('0975f876-a5c1-4a3b-9e9b-5556baee3027', 8, 'testimonial_email', 'Testimonial Email Draft', 'textarea', 'Email draft...', 'Draft an email asking a past client for a testimonial.', true, 2, '2025-08-17 20:37:03.479882+00'),
	('3c6ff74d-ae3f-4d5f-8f6d-e86dd4f4f1f5', 8, 'google_my_business', 'Google My Business Setup', 'textarea', 'Step: ____', 'Have you set it up? If not, what''s your first step?', true, 3, '2025-08-17 20:37:03.479882+00'),
	('681cbf48-0d87-4428-bd71-1b74955cfc11', 9, 'social_media_plan', 'Social Media Plan', 'textarea', 'Platforms & ideas...', 'Where does your ideal client hang out online? What kind of posts get the most engagement?', true, 1, '2025-08-17 20:37:03.479882+00'),
	('bc6e67ff-2992-4dd3-b168-76babd761fe9', 9, 'networking_notes', 'Networking & Engagement Notes', 'textarea', 'Notes...', 'Post a question on your chosen platform. Did anyone respond? Attend a networking event. What did you learn?', true, 2, '2025-08-17 20:37:03.479882+00'),
